data = ""

import string
lettres = string.ascii_lowercase

minSize = 99999
for lettre in lettres:
	print(lettre)
	newData = data.replace(lettre, '').replace(lettre.upper(), '')
	previousSize = len(newData)
	
	while True:
		for lettre in lettres:
			newData = newData.replace(lettre+lettre.upper(), '').replace(lettre.upper()+lettre, '')
		
		currentSize = len(newData)
		if currentSize == previousSize:
			break
		else:
			previousSize = currentSize
				
	if currentSize < minSize:
		minSize = currentSize
		print(minSize)
		
print(minSize)
